-- -----------------------------
SET FOREIGN_KEY_CHECKS = 0;


DROP TABLE IF EXISTS `xt_access`;
CREATE TABLE `xt_access` (
  `role_id` smallint(6) unsigned NOT NULL,
  `node_id` smallint(6) unsigned NOT NULL,
  `level` tinyint(1) NOT NULL,
  `pid` smallint(6) NOT NULL,
  `module` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  KEY `groupId` (`role_id`) USING BTREE,
  KEY `nodeId` (`node_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `xt_address`;
CREATE TABLE `xt_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `name` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `address` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `tel` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `moren` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



DROP TABLE IF EXISTS `xt_area`;
CREATE TABLE `xt_area` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(6) NOT NULL,
  `name` varchar(20) NOT NULL,
  `citycode` varchar(6) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3145 DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS `xt_article_category`;
CREATE TABLE `xt_article_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `site_id` int(11) DEFAULT NULL COMMENT '站点ID',
  `channel_id` int(11) NOT NULL COMMENT '频道ID',
  `title` varchar(100) DEFAULT NULL COMMENT '类别标题',
  `call_index` varchar(50) DEFAULT NULL COMMENT '调用别名',
  `parent_id` int(11) DEFAULT NULL COMMENT '父类别ID',
  `class_list` text COMMENT '类别ID列表(逗号分隔开)',
  `class_layer` int(11) DEFAULT NULL COMMENT '类别深度',
  `sort_id` int(11) DEFAULT NULL COMMENT '排序数字',
  `link_url` varchar(255) DEFAULT NULL COMMENT 'URL跳转地址',
  `img_url` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `content` longtext COMMENT '备注说明',
  `seo_title` varchar(255) DEFAULT NULL COMMENT 'SEO标题',
  `seo_keywords` varchar(255) DEFAULT NULL COMMENT 'SEO关健字',
  `seo_description` varchar(255) DEFAULT NULL COMMENT 'SEO描述',
  `is_lock` tinyint(4) DEFAULT '0' COMMENT '状态0正常1禁用',
  `addtime` int(11) DEFAULT NULL,
  `slide` text,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=132 DEFAULT CHARSET=utf8 COMMENT='文章类别表';



DROP TABLE IF EXISTS `xt_article_goods`;
CREATE TABLE `xt_article_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `channel_id` int(11) DEFAULT NULL COMMENT '频道ID',
  `article_id` int(11) DEFAULT NULL COMMENT '文章ID',
  `goods_no` varchar(50) DEFAULT NULL COMMENT '货号',
  `spec_ids` text COMMENT '规格ID以逗号分隔开',
  `spec_text` longtext COMMENT '规格描述',
  `stock_quantity` int(11) DEFAULT NULL COMMENT '库存数量',
  `market_price` decimal(9,2) DEFAULT NULL COMMENT '市场价格',
  `sell_price` decimal(9,2) DEFAULT NULL COMMENT '销售价格',
  `sn_num` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=468 DEFAULT CHARSET=utf8 COMMENT='商品价格';



DROP TABLE IF EXISTS `xt_article_goods_spec`;
CREATE TABLE `xt_article_goods_spec` (
  `channel_id` int(11) DEFAULT NULL COMMENT '频道ID',
  `article_id` int(11) DEFAULT NULL COMMENT '文章ID',
  `spec_id` int(11) DEFAULT NULL COMMENT '规格ID',
  `parent_id` int(11) DEFAULT NULL COMMENT '规格父ID',
  `title` varchar(100) DEFAULT NULL COMMENT '规格标题',
  `img_url` varchar(255) DEFAULT NULL COMMENT '规格图片'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='商品对应规格';



DROP TABLE IF EXISTS `xt_article_spec`;
CREATE TABLE `xt_article_spec` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `channel_id` int(11) DEFAULT NULL COMMENT '所属频道',
  `parent_id` int(11) DEFAULT NULL COMMENT '父节点ID',
  `title` varchar(100) DEFAULT NULL COMMENT '规格标题',
  `img_url` varchar(255) DEFAULT NULL COMMENT '规格图片',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注说明',
  `sort_id` int(11) DEFAULT NULL COMMENT '排序数字',
  `addtime` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=133 DEFAULT CHARSET=utf8 COMMENT='商品规格';



