DROP TABLE IF EXISTS `xt_cart`;
CREATE TABLE `xt_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `article_id` int(11) NOT NULL,
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '购买数量',
  `createtime` int(11) NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1：正常，2：已购买',
  `goods_id` int(11) DEFAULT '0',
  `spec_text` varchar(255) DEFAULT NULL,
  `seller_id` int(11) DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `hot_id` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;



