  `payment_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `express_id` int(11) DEFAULT NULL COMMENT '快递ID',
  `express_no` varchar(100) DEFAULT NULL COMMENT '快递单号',
  `express_fee` decimal(9,2) DEFAULT NULL COMMENT '物流费用',
  `express_status` tinyint(4) DEFAULT NULL COMMENT '发货状态1未发货2已发货',
  `express_time` int(11) DEFAULT NULL COMMENT '发货时间',
  `accept_name` varchar(50) DEFAULT NULL COMMENT '收货人姓名',
  `post_code` varchar(20) DEFAULT NULL COMMENT '邮政编码',
  `telphone` varchar(30) DEFAULT NULL COMMENT '联系电话',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机',
  `email` varchar(30) DEFAULT NULL COMMENT '邮箱',
  `area` varchar(100) DEFAULT NULL COMMENT '所属省市区',
  `address` text COMMENT '收货地址',
