  `payable_amount` decimal(9,2) DEFAULT NULL COMMENT '应付商品总金额',
  `real_amount` decimal(9,2) DEFAULT NULL COMMENT '实付商品总金额',
  `order_amount` decimal(9,2) DEFAULT NULL COMMENT '订单总金额',
  `point` int(11) DEFAULT NULL COMMENT '积分,正数赠送|负数消费',
  `status` tinyint(4) DEFAULT '1' COMMENT '订单状态1生成订单,2确认订单,3完成订单,4取消订单,5作废订单,6',
  `add_time` int(11) DEFAULT NULL COMMENT '下单时间',
