  `is_give` int(11) DEFAULT '0',
  `give_user_id` int(11) DEFAULT '0',
  `shop_id` int(11) DEFAULT NULL,
  `money_status` int(11) DEFAULT '0',
  `money_time` int(11) DEFAULT NULL,
  `all_crowd_price` decimal(9,2) DEFAULT '0.00',
  `is_money` int(11) DEFAULT '0',
  `crowd_id` int(11) DEFAULT '0',
  `is_cancel` int(11) DEFAULT '0',
  `cancel_time` int(11) DEFAULT NULL,
  `goods_shop_id` int(11) DEFAULT '0',
  `cancel_reason` varchar(255) DEFAULT NULL,
  `back_time` int(11) DEFAULT NULL,
  `back_reason` varchar(255) DEFAULT NULL,
  `back_status` int(11) DEFAULT NULL,
  `back_check_reason` varchar(255) DEFAULT NULL,
  `back_check_status` int(11) DEFAULT NULL,
  `back_check_time` int(11) DEFAULT NULL,
