\nleft join xt_fck a34\r\non(a33.father_id=a34.id) \r\nleft join xt_fck a35\r\non(a34.father_id=a35.id) \r\n\r\n) al\r\nwhere \r\n(pid=inPid\r\nor p2id=inPid\r\nor p3id=inPid\r\nor p4id=inPid\r\nor p5id=inPid\r\nor p6id=inPid \r\nor p7id=inPid \r\nor p8id=inPid \r\nor p9id=inPid \r\nor p10id=inPid \r\nor p11id=inPid \r\nor p12id=inPid \r\nor p13id=inPid \r\nor p14id=inPid\r\nor p15id=inPid \r\nor p16id=inPid \r\nor p17id=inPid  \r\nor p18id=inPid \r\nor p19id=inPid \r\nor p20id=inPid\r\nor p21id=inPid\r\nor p22id=inPid\r\nor p23id=inPid\r\nor p24id=inPid\r\nor p25id=inPid\r\nor p26id=inPid\r\nor p27id=inPid\r\nor p28id=inPid\r\nor p29id=inPid\r\nor p30id=inPid\r\nor p31id=inPid\r\nor p32id=inPid\r\nor p33id=inPid\r\nor p34id=inPid\r\nor p35id=inPid\r\n)    )   )  t  ORDER BY id ASC', '0|3', '', '3', '1:0', '1.5', '0|0|100000', '1.5', '1.5', '4', '10', '0|0|0', 'http://zyadmin.super-nba.com/APP/down.html', 'http://zyadmin.super-nba.com/APP/down.html', '0|100', '3', '1', '0.00', '', '10', '100|15', '1', '', '1|1|1|1|1|1', '10', '0|10|15|20|25|30', '0', '', '100', '', '0|0|5|5|5|5');
