INSERT INTO `xt_form` VALUES ('1080', '彭措总裁受邀出席“第五届世界健康产业大会”', '&lt;p&gt;&lt;/p&gt;&lt;div class=&quot;mod mod-html&quot;&gt;&lt;p&gt;&lt;img src=&quot;http://pic.kuaizhan.com/g3/d4/7f/0d6e-7bbe-4db0-a234-9ab0af9a732a28&quot; alt=&quot;&quot; style=&quot;border: 0px;vertical-align: middle&quot; wx_src=&quot;http://image.dtb315.com/?src_img=/Uploads/image/2017-03-06/58bd2a2e21a49.png&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: 宋体;font-size: 14px&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;2016&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;年&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;04&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;月&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;14&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;日，“第五届世界健康产业大会”——“一带一路健康产业创新之路”高层论坛，在北京皇家大饭店会议大厅举行。来自世界&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;50&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;多个国家的政经领袖和业界精英齐聚一堂，大健康良心产业联盟、中泰天慈健康产业集团彭措总裁受邀出席。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: 宋体;font-size: 14px&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;彭措总裁在会上做了《健康之路起点与终点》主题发言。指出，健康前面加上这个&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;“大”字，就是要全过程的，全产业的健康。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: 宋体;font-size: 14px&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;健康是人类永恒的话题，当前的形势下，是做&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;“健康天使”传播健康，还是做“危害天使”？利他为大，利己为小。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: 宋体;font-size: 14px&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;健康产业的良机在哪里？健康人类，要全方位的健康，不能以经济效益为中心。是时候该思考了，到底&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;GDP&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;第一，还是健康第一？彭措总裁认为，在产业项目发展上，要力求体现“绿色、低碳、环保”三个核心点，串联起构筑生态文明、美丽中国的核心内涵，更重要的是要体现新时期国家发展的意志，要对得起人类、社会、家庭、地球！&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;最后，彭措总裁代表大健康良心产业联盟宣言：要凝聚文明的力量，唤起全社会的共鸣，共建大健康生态圈。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;彭措总裁高瞻远瞩的战略阐述，赢得了与会人员的高度认可和一致好评。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-left: 0;text-indent: 31px;text-align: justify&quot;&gt;&lt;span style=&quot;font-family: 宋体;font-size: 14px&quot;&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;据悉，&lt;/span&gt;&lt;span style=&quot;font-family: SimSun;font-size: 16px&quot;&gt;“世界健康产业大会每年定期（世界卫生日前后）在中国北京召开，由产业论坛、产品博览、公益活动三大部分组成，被誉为全球健康产业的最高级别盛会。本次会议和千余家“中国国际健康产业博览会”的参展商，以及数万名各界参观者一起，要共同推动和见证“全球健康革命”的到来。&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;float: right&quot;&gt;责任编辑：管理员&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;/div&gt;&lt;p&gt;&lt;/p&gt;', '', '', '0', '1553957207', '1553959544', '1', '0', '84', '1', '/UPLOAD_PATHtemp/2019/03-30/b792b274a2ceb64eae19ef5bbdd506ac.png', '', '0', '');
